  fullName: "com.google.datastore.v1.PartitionId"
  type: "Class"
  package: "com.google.datastore.v1"
  summary: "\n A partition ID identifies a grouping of entities. The grouping is always\n by project and namespace, however the namespace ID may be empty.\n\n A partition ID contains several dimensions:\n project ID and namespace ID.\n\n Partition dimensions:\n\n - May be <code>\"\"</code>.\n - Must be valid UTF-8 bytes.\n - Must have values that match regex <code>[A-Za-z&#92;d&#92;.&#92;-_]{1,100}</code>\n If the value of any dimension matches regex <code>__.*__</code>, the partition is\n reserved/read-only.\n A reserved/read-only partition ID is forbidden in certain documented\n contexts.\n\n Foreign partition IDs (in which the project ID does\n not match the context project ID ) are discouraged.\n Reads and writes of foreign partition IDs may fail if the project is not in\n an active state.\n \n\n Protobuf type <code>google.datastore.v1.PartitionId</code>"
